export async function fetchFirstAid(injury: string) {
  const res = await fetch(`http://localhost:5000/firstaid/${injury}`);
  return await res.json();
}

export async function parseInjuryWithAI(query: string) {
  const res = await fetch(`http://localhost:5000/parse_injury/${encodeURIComponent(query)}`);
  return await res.json();
}
